  ModalBody
} from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

class Marvel extends Component {

  render() {
    return (
      <Col xlg="12">
      <h1 style={{textAlign:"center"}}>MARVEL API</h1>
